Dayna Vendetta - The Coma Bone

Added: February 10, 2011

Size:  465 Mb

Daynas husband is in a coma, and Dayna is having serious trouble dealing with the lack of sex. Lucky for her, her husbands doctor is very caring, and will do anything to make her feel better. Her husband might be in a coma, but that doesn't mean her sex life has to be...

